INSERT INTO `compro` (`id`, `title`, `content`) VALUES
(1, 'Tentang Kami', '<p>Kami adalah perusahaan yang begerak di bidang jasa tour and&nbsp;travel dan sudah menyambut tamu sejak tahun 2000, pelyanan kami meliputi penukaran uang, ticketing, tour package, hotel reservation, dan villa reservation. pelayanan yang ramah, murah, dan terpercaya membuat sampai hari ini perusahaan kami masih terus berkembang dan sudah mendapat banyak kepercayaan dari costumer - costumer kami.</p>\n\n<p>Keunggulan Bafageh Tour and Travel :</p>\n\n<p>- Best rate money changer di&nbsp;Bogor&nbsp;</p>\n\n<p>- Harga hotel/villa relatif lebih murah&nbsp;</p>\n\n<p>- Package tour yang murah dengan kualitas hotel berbintang</p>\n\n<p>- Free safety box&nbsp;</p>\n\n<p align=\"center\">-- KENYAMANAN ANDA ADALAH PRIORITAS KAMI --</p>\n'),
(2, 'Filosofi Perusahaan', '<p align=justify>Apa rasanya berada sendiri diantara kerumunan yang kita tidak kenal ?? bingung ?? takut ?? khawatir ??&nbsp;<br />\r\nYa itulah dasar filosofi kami, kami hadir untuk melayani dan menjadi tempat / wadah untuk para tourist khususnya pelancong timur tengah yang ingin mendapat infromasi dan mengetahui daerah wisata puncak bogor dan menyediakan segala fasilitas yang dibutuhkan dengan mengedepankan pelayanan terbaik.</p>\r\n'),
(3, 'Sejarah Singkat Perusahaan', '<p align=justify>Perusahaan kami Bafageh Tour berdiri pada tanggal 01 Januari 2000 dengan hanya beranggotakan 1 pemilik dan 1 karyawan dengan luas kantor hanya sekitar 2 x 3 M2 yang berbentuk konter dengan 1 meja service. Seiring berjalannya waktu customer mulai mengenal nama jasa wisata kami dengan semua servicenya, dan sang owner kami<strong> H A HASAN AHMAD BAFAGEH </strong> pun berani untuk memperluas tempat kontrak kami yang berupa konter dan merubahnya menjadi sebuah office kecil beserta tambahan pelayanan dan peningktan qualitasnya, di tahun 2009 mungkin adalah masa bangkit tumbuhnya kami diantara ketatnya kompetisi persaingan pariwisata tourist timur tengah dengan semua kelengkapan fasilitas dan harga rendah dengan menggunakan basis volume target.<br />\r\nDan kami masih terus setia melayani cutomer kami untuk mendapatkan kenyamanan dan melayani kebutuhannya untuk mendapatkan kepuasaan dan menjaga daerah wisata puncak untuk tetap bisa menjadi pilihan utama para tourist.</p>\r\n');
