INSERT INTO `faq` (`id_faq`, `title`, `content`) VALUES
(1, 'Syarat Booking', '<h3><strong>Selamat datang di&nbsp;Bafageh.com</strong></h3>\n\n<p><strong>Situs ini di kelola oleh&nbsp;PT. BAFAGEH TOUR &amp; TRAVEL.</strong></p>\n\n<p><strong>Bafageh Tour &amp; Travel merupakan agent pemasaran Produk dan jasa dari pihak ke tiga (<em>Mitra kerja</em>).</strong></p>\n\n<p><strong>Segala bentuk pemesanan atau pembelian produk dan jasa di situs ini kami sediakan dalam bentuk media elektronik seperti Email.</strong></p>\n\n<p><strong>Pengguna layanan situs ini memiliki tangung jawab penuh untuk memeriksa pesanan yang dilakukan dan semua data yang dimasukan sesuai dengan identitas diri (KTP/ ID&nbsp;card/ Passport/ No telepon/ Alamat).</strong></p>\n\n<p><strong>Kami sebagai penyedia layanan berhak menggunakan data tersebut untuk kebutuhan pemesanan kepada pihak ke tiga (<em>Mitra kerja</em>).</strong></p>\n\n<p><strong>Jika terjadi kesalahan data informasi yang diberikan kepada kami, itu sepenuhnya merupakan kesalahan pemesan.</strong></p>\n\n<p><strong>Setelah melakukan pembayaran pesanan, lakukan konfirmasi pembayaran pada kolom&nbsp; &nbsp; &nbsp; &nbsp; &quot; Confirmation Order &quot; .</strong></p>\n\n<p><strong>Segala bentuk pembatalan pesanan atau pembelian yang sudah dilakukan, tidak dapat dilakukan pengembalian dana transfer (No Cancellation &amp; Non Refundable).</strong></p>\n'),
(2, 'Ketentuan Bayar', '<p><strong>Dengan ini saya menyetujui pemesanan.</strong></p>\n\n<p><strong>Lakukan pembayaran segera sesuai dengan nominal yang harus dibayarkan untuk menghindari pembatalan secara otomatis, jika tidak dilakukan pembayaran selama 2 jam setelah dilakukan booking.</strong></p>\n\n<p><strong>jika telah melakukan pembayaran, Pesanan tersebut tidak dapat dibatalkan dan tidak dapat dilakukan pengembalian dana.</strong></p>\n\n<p><strong>Terimakasih</strong></p>\n'),
(3, 'Thank You 1', '<p><strong>Terimakasih telah melakukan pemesanan di Bafageh.com</strong></p>\n\n<p><strong>Segera lakukan pembayaran dan lakukan&nbsp;konfirmasi pembayaran segera pada kolom &quot; Confirmation Order &quot;.</strong></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n'),
(4, 'Thank You 2', '<p><strong>Kami akan segera mengirimkan Voucher melalui Email setelah&nbsp;kami verifikasi pembayaran anda.</strong></p>\n\n<p>&nbsp;</p>\n');
