INSERT INTO `intinerary` (`id_intinerary`, `title_intinerary`, `content_intinerary`, `paketid`) VALUES
(1, '(Note : ada 2 opsi tour anda dapat memilih salah satu.)', '<ul>\r\n	<li>Penjemputan di Bandara Ngurah Rai.</li>\r\n	<li>Ke pantai kuta.</li>\r\n	<li>Ke monumen bom bali.</li>\r\n	<li>Check in Hotel paling awal jam 14:00 WITA.</li>\r\n	<li>Makan malam (Exclude).</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Istirahat .</li>\r\n</ul>\r\n', 1),
(2, ' ', '<p>Nusa Dua Tour (Opsi A).</p>\r\n\r\n<ul>\r\n	<li>Sarapan pagi di hotel.</li>\r\n	<li>Ke pantai tanjung benoa, ke kawasan water sport, banana boat/ jet ski/ parasailing, etc (exclude tiket).</li>\r\n	<li>Ke kawasan wisata patung Garuda Wisnu Kencana (exclude tiket).</li>\r\n	<li>Menyaksikan Tarian tradisional Bali.</li>\r\n	<li>Makan siang (exclude).</li>\r\n	<li>Ke pantai pandawa beach.</li>\r\n	<li>Hunting sunset di Pura Uluwatu.</li>\r\n	<li>Makan malam Di jimbaran (Exclude).</li>\r\n	<li>Kembali ke hotel dan istirahat.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ubud Tour (Opsi B).</p>\r\n\r\n<ul>\r\n	<li>Sarapan pagi di hotel.</li>\r\n	<li>Ke monkey Forest Ubud (exclude tiket).</li>\r\n	<li>Ke pasar Traditional Ubud.</li>\r\n	<li>Ke kawasan Sawah Terasering Tegalalang Ubud (exclude tiket).</li>\r\n	<li>Makan siang (exclude).</li>\r\n	<li>Ke Pura Tirta Empul Tampak Siring (exclude tiket).</li>\r\n	<li>Makan malam (Exclude).</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Kembali ke hotel dan stirahat.</li>\r\n</ul>\r\n', 1),
(3, ' ', '<p>Bedugul Tour (Opsi A).</p>\r\n\r\n<ul>\r\n	<li>Sarapan pagi di hotel</li>\r\n	<li>Ke pura taman ayun (exclude tiket).</li>\r\n	<li>Makan siang (exclude).</li>\r\n	<li>Ke daerah bedugul.</li>\r\n	<li>Ke Pura Ulun Danu diujung Danau Beratan (exclude tiket).</li>\r\n	<li>Hunting sunset di kawasan Pura Tanah Lot (exclude tiket).</li>\r\n	<li>Makan malam (Exclude).</li>\r\n	<li>Kembali ke hotel dan Istirahat.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kintamani Tour (Opsi B).</p>\r\n\r\n<ul>\r\n	<li>Sarapan pagi di hotel</li>\r\n	<li>Ke Daerah kintamani, hunting foto Danau dan gunung batur (exclude tiket).</li>\r\n	<li>Ke kawasan batur Volcano (exclude tiket).</li>\r\n	<li>Makan siang (exclude).</li>\r\n	<li>Ke pemandian air panas penelokan (exclude tiket).</li>\r\n	<li>Makan malam (exclude).</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Kembali ke hotel dan istirahat.</li>\r\n</ul>\r\n', 1),
(4, ' ', '<ul>\r\n	<li>Sarapan pagi di hotel.</li>\r\n	<li>Check out dari hotel .</li>\r\n	<li>Belanja di krisna pusat oleh-oleh (pribadi).</li>\r\n	<li>Ke pusat oleh-oleh Joger (Pribadi).</li>\r\n	<li>Kembali ke lokasi penjemputan di Bandara Ngurah Rai.</li>\r\n</ul>\r\n', 1),
(5, '(Note : ada 2 opsi tour anda dapat memilih salah satu.)', '<ul>\r\n	<li>Penjemputan di Bandara Lombok.</li>\r\n	<li>Pengalungan Souvenir.</li>\r\n	<li>Menuju Mataram makan siang (Exclude).</li>\r\n	<li>Tour mengunjungi Museum di Mataram.</li>\r\n	<li>Mengunjungi Islamic Center di Mataram.</li>\r\n	<li>Check In hotel paling awal jam 14:00 WITA.</li>\r\n	<li>Hunting sunset di pantai Senggigi.</li>\r\n	<li>Makan malam (Exclude)</li>\r\n	<li>Kembali ke hotel dan Istirahat.</li>\r\n</ul>\r\n', 2),
(6, 'Asak Tour', '<p>Asak Tour</p>\n\n<ul>\n	<li>Sarapan pagi di hotel</li>\n	<li>Ke objek wisata Desa Sukarare/ Sentra Kain Tenun.</li>\n	<li>Desa adat sade.</li>\n	<li>Makan siang (Exclude).</li>\n	<li>Tanjung Aan Beach.</li>\n	<li>Bukit Merese.</li>\n	<li>Makan malam (exclude).</li>\n	<li>Kembali ke hotel dan istirahat.</li>\n</ul>\n', 2),
(7, '', '<p>Waterfall Sendang Gile &amp; Tiu Kelep (Opsi A)</p>\n\n<ul>\n	<li>Sarapan pagi di hotel.</li>\n	<li>Menuju Desa Selnaru.</li>\n	<li>Makan siang (exclude).</li>\n	<li>Explore Sendang gile Waterfall.</li>\n	<li>Explore Tiu Kelep Waterfall.</li>\n	<li>Makan malam (exclude).</li>\n	<li>Kembali ke hotel dan istirahat.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>Gili Nanggu, Gili Sudak &amp; Gili Kedis (Opsi B)</p>\n\n<ul>\n	<li>Sarapan pagi di hotel.</li>\n	<li>Menuju pelabuhan Tawun.</li>\n	<li>Dengan Private slow boat menuju Gili Nanggu (Exclude Tiket).</li>\n	<li>Explore Gili nanggu, berenang/ Snorkeling/ game/ etc. (Exclude)</li>\n	<li>Explore Gili kedis</li>\n	<li>Kembali ke pelabuhan Tawun.</li>\n	<li>Ke Pusat oleh-oleh.</li>\n	<li>Makan malam (Exclude).</li>\n	<li>Kembali ke hotel dan istirahat.</li>\n</ul>\n', 2),
(8, '', '<ul>\n	<li>Sarapan pagi di hotel.</li>\n	<li>Check out dari hotel .</li>\n	<li>Ke pusat oleh-oleh khas Lombok (Pribadi).</li>\n	<li>Kembali ke lokasi penjemputan di Bandara Lombok.</li>\n</ul>\n', 2),
(9, '', '<ul>\n	<li>Penjemputan di Bandara Ngurah Rai.</li>\n	<li>Ke pantai kuta.</li>\n	<li>Ke monumen bom bali.</li>\n	<li>Check in Hotel paling awal jam 14:00 WITA.</li>\n	<li>Makan malam (Exclude).</li>\n</ul>\n\n<ul>\n	<li>Istirahat .</li>\n</ul>\n', 3),
