INSERT INTO `paket` (`idpaket`, `nama_paket`, `deskripsi`, `kategori_id`, `gambar`, `likes`, `jml`, `is_active`) VALUES
(1, 'Bali 4 Hari 3 Malam', '<p>Paket yang kami sediakan akan membawa anda menikmati eksotisme alam Bali, dengan mengunjungi beberapa objek wisata yang menjadi ikon Pulau Dewata Bali, dan pengalaman menginap di hotel bintang 4 yang menjadi best support kami di bali.</p>\r\n\r\n<p>Dengan harga yang kami tawarkan anda sudah bisa menikmati Bali dengan pengalaman yang tak terlupakan bersama teman / keluarga tercinta .</p>\r\n\r\n<h3><strong>Condition Package</strong></h3>\r\n\r\n<ul>\r\n	<li>Harga bisa berubah sewaktu-waktu tanpa pemberitahuan terlebih dahulu.</li>\r\n	<li>Harga tersebut tidak berlaku pada musim liburan, High season, dan akhir tahun.</li>\r\n	<li>Harga berlaku untuk &nbsp;WNA (Timur tengah/ Saudi arabia).</li>\r\n	<li>Tour bisa berubah tergantung kondisi dilapangan.</li>\r\n</ul>\r\n\r\n<h3><strong>Include</strong></h3>\r\n\r\n<ul>\r\n	<li>Private Transport.</li>\r\n	<li>3 malam di hotel *4.</li>\r\n	<li>Sarapan untuk 2 orang dalam 1 kamar.</li>\r\n	<li>Tour ke objek wisata setiap hari.</li>\r\n	<li>Menjemput dari bandara ke hotel.</li>\r\n	<li>Mengantar pulang ke bandara.</li>\r\n</ul>\r\n\r\n<h3><strong>Exclude</strong></h3>\r\n\r\n<ul>\r\n	<li>Tiket pesawat pulang pergi (Round trip).</li>\r\n	<li>Makan siang dan Makan malam.</li>\r\n	<li>Cemilan selama di perjalanan.</li>\r\n	<li>Tiket objek wisata.</li>\r\n	<li>Laundry dan pengeluaran selama di hotel.</li>\r\n</ul>\r\n', 1, 'd53cebdd3a9fddef7a4ce625b886a8b1.jpg', 0, 3, 0),
(2, 'Lombok 4 Hari 3 Malam', '<p>Paket tour 4 hari akan membawa anda dan keluarga anda untuk menikmati pemandangan Pulau Lombok dengan mengunjungi Pantai-pantai yang indah di Lombok seperti Pantai Kuta/ Pantai mandakila Lombok/ Pantai Pink dan beberapa Pulau Gili untuk Snorkeling dan hunting photo, Serta terakhir City Tour untuk membeli oleh-oleh khas lombok</p>\r\n\r\n<p>Dengan harga yang kami tawarkan anda sudah dapat menikmati pulau Lombok dan pengalaman menginap di hotel bintang 4, dan menjadikan pengalaman yang tidak akan terlupakan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Condition Package</strong></h3>\r\n\r\n<ul>\r\n	<li>Harga bisa berubah sewaktu-waktu tanpa pemberitahuan terlebih dahulu.</li>\r\n	<li>Harga tersebut tidak berlaku pada musim liburan, High season, dan akhir tahun.</li>\r\n	<li>Harga berlaku untuk&nbsp; WNA (Timur tengah/ Saudi arabia).</li>\r\n	<li>Tour bisa berubah tergantung kondisi dilapangan</li>\r\n</ul>\r\n\r\n<h3><strong>Include</strong></h3>\r\n\r\n<ul>\r\n	<li>Private Transport.</li>\r\n	<li>3 malam di hotel *4.</li>\r\n	<li>Sarapan untuk 2 orang dalam 1 kamar.</li>\r\n	<li>Tour ke objek wisata setiap hari.</li>\r\n	<li>Tiket masuk objek wisata.</li>\r\n	<li>Menjemput dari bandara ke hotel.</li>\r\n	<li>Mengantar pulang ke bandara.</li>\r\n	<li>Tax dan service</li>\r\n</ul>\r\n\r\n<h3><strong>Exclude</strong></h3>\r\n\r\n<ul>\r\n	<li>Tiket pesawat pulang pergi (Round trip).</li>\r\n	<li>Makan siang dan Makan malam.</li>\r\n	<li>Air minum dan Cemilan selama di perjalanan.</li>\r\n	<li>Tiket Boat untuk ke Gili.</li>\r\n	<li>Sewa alat snorkeling.</li>\r\n	<li>Laundry dan pengeluaran selama di hotel.</li>\r\n	<li>Souvenir dan biaya pribadi.</li>\r\n</ul>\r\n', 2, 'bd9b3f1bbdbd63b17ffd1d922cdbc124.jpg', 5, 3, 0),
