(3, 'fa fa-binoculars', 'TRAVEL PACKAGE', '<p>Memberikan kemudahan kepada para wisatawan dengan&nbsp;menyediakan paket bali &amp; lombok dengan harga yang lebih&nbsp;murah,para wisatawan juga dapat memilih paket wisata yang kami tawarkan sehingga rencana liburan lebih praktis</p>\r\n'),
(4, 'fa fa-hotel', 'HOTEL RESERVATION', '<p>Banyak menu pilihan menarik hotel dan apartement dari bintang 2 sampai 5 di kota jakarta,bandung,bali dan lombok.para staff memberikan informasi yang detail mengenai hotel dengan 3 bahasa yang memberikan kemudahan bagi para wisatawan.</p>\r\n');
